class Ball extends NodePhysics {
    bg = graphics().circle(0, 0, 30).fill({color: 0x999999, alpha: 1})
    level = 1
    marker: Text
    shape = Bodies.circle(0, 0, 30, {
        restitution: 0.9,
        friction: 0.33,
        collisionFilter: {
            group: -1,
        },
        label: 'ball',
        slop: 0.01,
    })

    constructor() {
        super()

        this.marker = create_text({text: this.level, style: {fontSize: 50, fill: 'black', fontFamily: 'Calibri'}})

        this.addChild(this.bg)
        this.addChild(this.marker)

        PhysicsEngine.add(this, this.shape)
    }

    upgrade(value: number, mode = 'add') {
        if (mode === 'add') this.level += value
        if (mode === 'multiply') this.level *= value
        this.level = Math.ceil(this.level)
        this.marker.text = this.level
    }
}


